class Solution {
    public int maxRotateFunction(int[] A) {
        if (A == null || A.length == 0) {
            return 0;
        }
        int sum = 0;
        int f0 = 0;
        for (int i = 0; i < A.length; i++) {
            sum += A[i];
            f0 += i * A[i];
        }
        int max = f0;
        for (int i = 1; i < A.length; i++) {
            f0 = f0 + sum - A.length * A[A.length - i];
            max = Math.max(max, f0);
        }
        return max;
    }
}

